import React from "react";

const ViewProfile = ({ name, dob, courseName, institutionName, major, marks, startDate, endDate}) => {
  return (
    <div>
        <div style = {{display:"flex", flexDirection:"row", justifyContent:"space-between"}}>
        <p><b>{name} </b><span>{endDate}</span></p>
        </div>
        <h5 style={{marginLeft:"10px", marginTop:"10px", color:"crimson"}}>Education</h5>
        <div className="card" style={{marginLeft:"0px", padding:"10px"}}>
            <p><b>{institutionName}</b></p>
            <p>{courseName}, <span>{major}, </span> <span>{marks}</span></p>
            <p>{startDate} - <span>{endDate}</span></p>

        </div>
        <h5 style={{marginLeft:"10px", marginTop:"10px", color:"crimson"}}>Experience</h5>
        <div className="card" style={{marginLeft:"0px", padding:"10px"}}>
            <p><b>Ongrid Softwares</b></p>
            <p><span>21/06/2021 - </span><span>21/06/2031</span></p>
        </div>
        <a  className= "buttons" href="" style={{padding:"10px", marginTop:"10px"}}>View Portfolio</a>
    </div>
  );
};

export default ViewProfile;
